    false,nt"url": null,nt"notes": "This fine-scale vegetation classification
    and map of the Pine Creek and Fitzhugh Creek Wildlife Areas, Modoc County, California
    was created following FGDC and National Vegetation Classification Standards by the
    California Department of Fish and Game Vegetation Classification and Mapping Program
    VegCAMP. The map classification is based on a floristic classification that was
    derived from data collected in the field following the California Native Plant Society's
    Rapid Assessment protocol (www.cnps.org) in June, 2006 and analyzed by VegCAMP using
    cluster analysis to derive the classes. The map was digitized using true-color 2005
    1-meter National Agricultural Imagery Program (NAIP) imagery as the base. Almost
    all polygons were field checked and corrected in June 2007.",nt"license_title":
